import React, { Component } from 'react';
import MenuItem from './MenuItem';
import LanguagesItem from './LanguagesItem';

export default class MenuOptions{
    render(){
        return(<div id="menuOptions" class="menu_items hideMenu">
                {opciones.map( (elem) => <MenuItem name={elem.name}></MenuItem> )}
                </div>
        )

    }
}

MenuOptions.defaultProps={
    opciones : [{
        name: "Home",
        link: "#"
    }, 
    {
        name: "Characters",
        link: "#characterSection"
    }, 
    {
        name: "Islands",
        link: "#islandSection"
    }, 
    {
        name: "Mist Objects",
        link: "#mistSection"
    }],
    languages: ["English", "Spanish"]
}
